import styled from "styled-components";
import MainSecApp from './MainSecApp'


const SectionCTA = styled.section`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`

function Section03() {
    return (
        <SectionCTA>
            <MainSecApp />
            <MainSecAppImg />
        </SectionCTA>
    )
}

export default Section03
